import React from "react";

function Login() {
  return (
    <div className=" ">
      <div className="admin login bg-black w-full h-[40px] items-center text-white flex justify-end px-5">
        <button>Admin Login</button>
      </div>

      <nav className="w-full h-[90vh]"></nav>
    </div>
  );
}

export default Login;
